package com.tenXen.core.domain;public class Group extends BaseDomain {    private static final long serialVersionUID = 1L;    /**     * 群主ID     **/    private Integer owner;    /**     * 群标题     **/    private String title;    /**     * 备注     **/    private String remark;    /**     * 图片     **/    private String picPath;    public Integer getOwner() {        return this.owner;    }    public void setOwner(Integer owner) {        this.owner = owner;    }    public String getTitle() {        return this.title;    }    public void setTitle(String title) {        this.title = title;    }    public String getRemark() {        return this.remark;    }    public void setRemark(String remark) {        this.remark = remark;    }    public String getPicPath() {        return this.picPath;    }    public void setPicPath(String picPath) {        this.picPath = picPath;    }}